import React, { Component, PropTypes } from 'react';

class SelectBox extends React.Component {
    constructor(props) {
      super(props);
      this.state = {value: 'coconut'};

      this.handleChange = this.handleChange.bind(this);
    }

    handleChange(event) {
      this.setState({value: event.target.value});
      //this.props.updatePersonHandler(event,this.props.type,this.props.identifier)
    }

    render() {
      return (
        <select value={this.state.value} onChange={this.handleChange}>
        <option value="grapefruit">Grapefruit</option>
        <option value="lime">Lime</option>
        <option value="coconut">Coconut</option>
        <option value="mango">Mango</option>
      </select>
    //     <select value={this.state.value} onChange = {this.handleChange} disabled = {this.props.disabledInfo}>
    //     {this.props.optionsData.map(v => <option key = {this.props.identifier + v}  value = {v.toString()}>{v.toString()}</option>)}
    // </select>
      );
    }
  }

  export default SelectBox;
